function WorkoutGenerator( props ) {  
  return (
    <div className="workout-generator">
      {props.map(item =>
        <Exercise 
          key={ item.id }
          id={ item.id } 
          name={ item.name } 
          type={ item.type } 
          timing={ item.timing } 
          target={ item.target } 
        />)}
    </div>
  );
}

export default WorkoutGenerator;
